import ApplicationManager from './app/appManager';
import ApplicationDefaults from './app/defaults';
import Events from './app/events';
import localSettings from './app/localSettings';
import RouterBuilder from './app/router';
import Themes from './app/theme';
import AdminApplication from './components/App.vue';
import Sidebar from './components/application/Sidebar.vue';
import SinglePageApplication from './components/application/SinglePage.vue';
import AlternativeSourceEditor from './components/editor/alternateSourceEditor';
import defaultSourceEditorToolbarButtons from './components/editor/sourceEditor/defaultToolbarButtons';
import sourceEditorToolbarButtons from './components/editor/sourceEditor/toolbarButtons';
import HomePage from './components/pages/home/Home.vue';
import SimpleHomeWidget from './components/pages/home/SimpleHomeWidget.vue';
import PageWithHeader from './components/pages/PageWithHeader.vue';
import SimplePage from './components/pages/SimplePage.vue';
import SimpleTableCellBoolWidget from './components/table/cellWidget/bool';
import SimpleTableCellDateWidget from './components/table/cellWidget/date.vue';
import SimpleTableCellSizeWidget from './components/table/cellWidget/size.vue';
import SimpleTableCellTextWidget from './components/table/cellWidget/text.vue';
import SimpleTableFilterTextFilter from './components/table/filter/SimpleTableFilterTextFilter';
import SimpleTableFilterDropdownFilter from './components/table/filter/SimpleTableFilterDropdownFilter';
import SimpleTableIconRowActionWidget from './components/table/rowActionWidget/icon.vue';
import SimpleTableMoveItemRowActionWidget from './components/table/rowActionWidget/moveItem.vue';
import SimpleTablePublishRowActionWidget from './components/table/rowActionWidget/publish.vue';
import SimpleTableFilter from './components/table/simpleTableFilter';
import Asset from './components/asset/Asset.vue';
import FilePicker from './components/asset/FilePicker.vue';
import isJson from './components/veeValidate/json';
import languageCodes from './const/languageCodes';
import WarningDialog from './components/dialog/warningDialog';

import ApplicationError from './error/applicationError';
import HomePageBuilder from './page/homePageBuilder';
import PermissionHandler from './permission/handler';
import AdminApplicationPlugin from './plugins/adminApplication';
import AuthService from './service/auth';
import SettingsService from './service/settings';
import UserService from './service/user';
import AdminApplicationManagerStorePlugin from './store/appManagerPlugin';
import StoreBuilder from './store/builder';
import SettingsStoreModule from './store/modules/settings';
import UserStoreModule from './store/modules/user';
import MutationTypes from './store/mutation-types';
import SimpleTableAlign from './table/align';
import SimpleTableController from './table/controller';
import SimpleTableSortOrder from './table/sortOrder';
import DateUtil from './util/date';

const validators = {
    veevalidate: {
        isJson
    }
};

const errors = {
    ApplicationError
};

const editor = {
    sourceEditor: {
        toolbar: {
            buttons       : sourceEditorToolbarButtons,
            defaultButtons: defaultSourceEditorToolbarButtons
        }
    }
};

export {
    AdminApplication,
    Sidebar,
    SinglePageApplication,
    HomePage,
    SimpleHomeWidget,
    PageWithHeader,
    SimplePage,
    ApplicationManager,
    Events,
    localSettings,
    RouterBuilder,
    AdminApplicationPlugin,
    PermissionHandler,
    AuthService,
    UserService,
    SettingsService,
    StoreBuilder,
    AdminApplicationManagerStorePlugin,
    MutationTypes,
    SettingsStoreModule,
    UserStoreModule,
    SimpleTableController,
    SimpleTablePublishRowActionWidget,
    SimpleTableCellDateWidget,
    SimpleTableCellSizeWidget,
    SimpleTableCellTextWidget,
    SimpleTableCellBoolWidget,
    SimpleTableMoveItemRowActionWidget,
    SimpleTableSortOrder,
    SimpleTableAlign,
    SimpleTableIconRowActionWidget,
    ApplicationDefaults,
    DateUtil,
    SimpleTableFilterTextFilter,
    SimpleTableFilterDropdownFilter,
    SimpleTableFilter,
    HomePageBuilder,
    Themes,
    errors,
    languageCodes,
    Asset,
    FilePicker,
    editor,
    validators,
    AlternativeSourceEditor,
    WarningDialog
};
